  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143931 includes discrete
  sample and profile data collected from PROFESSOR MULTANOVSKIY in the North Atlantic
  Ocean from 1993-09-11 to 1993-11-21. These data include DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRITE, SALINITY, WATER TEMPERATURE, nitrate + nitrite content (concentration),
  phosphate and silicate. The instruments used to collect these data include CTD and
  bottle.nnThese data were collected by Vladimir Tereschenkov of Russian Academy of
  Sciences; P.P. Shirshov Institute of Oceanology as part of the WOCE_A03_90CT19930911
  data set. CDIAC associated the following cruise ID(s) with this data set: WOCE_A03_1993nnThe
  World Ocean Circulation Experiment (WOCE) was a major component of the World Climate
  Research Program with the overall goal of better understanding the ocean's role
  in climate and climatic changes resulting from both natural and anthropogenic causes.
  The CO2 survey took advantage of the sampling opportunities provided by the WOCE
  Hydrographic Program (WHP) cruises during this period between 1990 and 1998. The
  final collection covers approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"license_title\":
